import { createStore } from 'vuex'
import axios from "axios";
import * as url from "url";

export default createStore({
  state: {
    products: []
  },
  getters: {
    PRODUCTS(state){
      return state.products;
    }
  },
  mutations: {
  },
  actions: {
    GET_PRODUCTS_FROM_API(commit){
      return axios('http://localhost:3000/products', {
          method: "GET"
      })
          .then()
    }
  },
  modules: {
  }
})
